import Task from "./Task";

export const Tasks = ({ tasks, onDelete, onToggle, buttonTask }) => {
  return (
    <div>
      {tasks.map((task) => {
        return (
          <Task
            buttonTask={buttonTask}
            key={task.id}
            task={task}
            onDelete={onDelete}
            onToggle={onToggle}
          ></Task>
        );
      })}
    </div>
  );
};
